/**
 * @param {number[]} nums
 * @param {number} m
 * @return {boolean}
 */
var canSplitArray = function(nums, m) {
    const n = nums.length;
    let prefixSums = new Array(n).fill(0);
    prefixSums[0] = nums[0];
    for (let i = 1; i < n; i++) {
        prefixSums[i] = prefixSums[i - 1] + nums[i];
    }

    // Helper function to calculate the sum of a subarray
    const subArraySum = (start, end) => {
        return prefixSums[end] - (start > 0 ? prefixSums[start - 1] : 0);
    };

    // DP array initialization
    let dp = Array.from({ length: n }, () => new Array(n + 1).fill(false));
    dp[0][1] = nums[0] >= m || nums.length === 1; // Initial condition

    // DP iteration
    for (let i = 0; i < n; i++) {
        for (let j = 1; j <= i + 1; j++) {
            if (i > 0 && !dp[i - 1][j - 1]) continue;
            for (let k = i; k < n; k++) {
                if (subArraySum(i, k) >= m || k - i === 0) {
                    dp[k][j + 1] = true;
                }
            }
        }
    }

    return dp[n - 1][n];
};
